// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

interface IERC20 {
   function _transferFrom(address from, address to, uint256 amount) external;
   function _transfer(address to, uint256 amount) external;
}

contract Timelock {

    event Locked(address indexed owner, address indexed token, uint256 amount, uint256 deadline);

     struct Lock {
         address owner;
         address token;
         uint256 amount;
         uint256 deadline;
         bool withdrawn;
     }

     mapping(address => Lock[]) userToLocks;

     function lock(address _token, uint256 _amount, uint256 _deadline) public {
         IERC20(_token)._transferFrom(msg.sender, address(this), _amount);
         Lock memory newLock = Lock(msg.sender, _token, _amount, _deadline,false);
         userToLocks[msg.sender].push(newLock);
         emit Locked(msg.sender,_token,_amount,_deadline);
     }

    // CHECK; EFFECTS; INTERACTIONS

     function withdraw(uint _index) public {
        Lock memory temp = userToLocks[msg.sender][_index];
        require(msg.sender == temp.owner, 'not the owner');
        require(!temp.withdrawn, 'withdrew already');
        require(temp.deadline < block.timestamp, 'too early');
        temp.withdrawn = true;
        userToLocks[msg.sender][_index] = temp;
        IERC20(temp.token)._transfer(msg.sender, temp.amount);
     }
}
